import ShowName from "./ShowName";

function App() {
  return (
    <>
      <ShowName name="Sabir" age={20} />
      <ShowName name="Taif" age={21} />
      <ShowName name="Raees" age={40} />
      <ShowName name="Siddiq" age={50} />
      <ShowName name="Kazi" age={60} />
    </>
  );
}

export default App;
